    'help.WhatShouldIDoIfISuspectAFraudulentSeller': '\u0DB8\u0DB8 \u0DC0\u0D82\u0DA0\u0DB1\u0DD2\u0D9A \u0D85\u0DBD\u0DD9\u0DC0\u0DD2\u0D9A\u0DBB\u0DD4\u0DC0\u0D9A\u0DD4 \u0D9C\u0DD0\u0DB1 \u0DC3\u0DD0\u0D9A \u0D9A\u0DC5\u0DC4\u0DDC\u0DAD\u0DCA \u0DB8\u0DA7 \u0D9A\u0DC5 \u0DC4\u0DD0\u0D9A\u0DCA\u0D9A\u0DDA \u0D9A\u0DD4\u0DB8\u0D9A\u0DCA\u0DAF?',
    'help.WhatShouldIDoIfISuspectAFraudulentSeller_content': '\u0DC0\u0DCA\u200D\u0DBA\u0DCF\u0DA2 \u0DC4\u0DDD \u0DC0\u0D82\u0DA0\u0DB1\u0DD2\u0D9A \u0DB4\u0DC5 \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0D9A\u0DCA \u0D85\u0DA9\u0DC0\u0DD2\u0DBA\u0DD9\u0DC4\u0DD2 \u0D87\u0DAD\u0DD2 \u0DB6\u0DC0 \u0D94\u0DB6\u0DA7 \u0DAF\u0DD0\u0DB1\u0DD4\u0DB1\u0DC4\u0DDC\u0DAD\u0DCA, \u0D9A\u0DBB\u0DD4\u0DAB\u0DCF\u0D9A\u0DBB <<CONTACTLINK>>\u0DB1\u0DD3\u0DAD\u0DD2 \u0D9A\u0DBB\u0DD4\u0DAB\u0DD4 <</CONTACTLINK>> \u0DC4\u0DD2\u0DAF\u0DD3 \u0D85\u0DB4 \u0DC4\u0DCF \u0DC3\u0DB8\u0DCA\u0DB6\u0DB1\u0DCA\u0DB0 \u0DC0\u0DB1\u0DCA\u0DB1.',
    'terms.BeforeSubmitting': '\u0D89\u0DAF\u0DD2\u0DBB\u0DD2\u0DB4\u0DAD\u0DCA \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0DA7 \u0DB4\u0DD9\u0DBB \u0D9A\u0DBB\u0DD4\u0DAB\u0DCF\u0D9A\u0DBB \u0D85\u0DB4\u0D9C\u0DDA <<LINK_TERMS_USE>>\u0DB1\u0DD2\u0DBA\u0DB8\u0DBA\u0DB1\u0DCA \u0DC3\u0DC4 \u0D9A\u0DDC\u0DB1\u0DCA\u0DAF\u0DDA\u0DC3\u0DD2<</LINK_TERMS_USE>> \u0D9A\u0DD2\u0DBA\u0DC0\u0DB1\u0DCA\u0DB1.',
    'terms.TermsOfUse': '\u0DB7\u0DCF\u0DC0\u0DD2\u0DAD \u0D9A\u0DDC\u0DB1\u0DCA\u0DAF\u0DDA\u0DC3\u0DD2',
    'about.AboutBrand': 'OLX \u0D9C\u0DD0\u0DB1',
    'about.AboutText1': 'OLX \u0DBA\u0DB1\u0DD4 \u0DA2\u0D82\u0D9C\u0DB8 \u0DC3\u0DC4 \u0D94\u0DB1\u0DCA\u0DBD\u0DBA\u0DD2\u0DB1\u0DCA \u0DBA\u0DB1 \u0D85\u0DBD\u0DD4\u0DAD\u0DD2\u0DB1\u0DCA \u0DB6\u0DD2\u0DC4\u0DD2\u0DC0\u0DB1 \u0DC0\u0DD9\u0DC5\u0DB3\u0DB4\u0DBD\u0DC0\u0DBD\u0DCA \u0DAF\u0DD9\u0D9A\u0DB8 \u0D89\u0DBD\u0D9A\u0DCA\u0D9A \u0D9A\u0DBB \u0D9C\u0DAD\u0DCA \u0DBD\u0DDD\u0D9A\u0DBA\u0DDA \u0DB4\u0DCA\u200D\u0DBB\u0DB0\u0DCF\u0DB1\u0DAD\u0DB8 \u0DBD\u0DD4\u0DC4\u0DD4\u0DAC\u0DD4 \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA \u0DC0\u0DDA\u0DAF\u0DD2\u0D9A\u0DCF\u0DC0 \u0DC0\u0DDA',
    'about.AboutText2': 'OLX \u0D9C\u0DDD\u0DBD\u0DD3\u0DBA \u0DC0\u0DC1\u0DBA\u0DD9\u0DB1\u0DCA \u0D9A\u0DCA\u200D\u0DBB\u0DD2\u0DBA\u0DCF\u0DAD\u0DCA\u0DB8\u0D9A \u0DC0\u0DB1 \u0D85\u0DAD\u0DBB \u0DBB\u0DA7\u0DC0\u0DBD\u0DCA 40\u0D9A\u0DA7 \u0D85\u0DB0\u0DD2\u0D9A \u0DC3\u0D82\u0D9B\u0DCA\u200D\u0DBA\u0DCF\u0DC0\u0D9A \u0DAD\u0DD2\u0DB6\u0DDA',
    'about.about_Body': '<p>OLX \u0DBA\u0DB1\u0DD4 \u0D9C\u0DCF\u0DC3\u0DCA\u0DAD\u0DD4 \u0DBB\u0DC4\u0DD2\u0DAD \u0DBD\u0DD4\u0DC4\u0DD4\u0DAC\u0DD4 \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA\u0DC0\u0DBD \u0D8A\u0DC5\u0D9F \u0DB4\u0DBB\u0DB8\u0DCA\u0DB4\u0DBB\u0DCF\u0DC0\u0DBA\u0DD2.<br /><br />OLX \u0D94\u0DB6 \u0D9A\u0DDC\u0DAD\u0DD0\u0DB1\u0D9A \u0DA2\u0DD3\u0DC0\u0DAD\u0DCA \u0DC0\u0DD4\u0DC0\u0DAD\u0DCA \u0DC0\u0DD2\u0D9A\u0DD2\u0DAB\u0DD3\u0DB8, \u0DB8\u0DD2\u0DBD\u0DA7 \u0D9C\u0DD0\u0DB1\u0DD3\u0DB8, \u0DC0\u0DD9\u0DC5\u0DB3\u0DCF\u0DB8, \u0DC3\u0DCF\u0D9A\u0DA0\u0DCA\u0DA1\u0DCF \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8, \u0DC3\u0D82\u0DC0\u0DD2\u0DB0\u0DCF\u0DB1\u0DBA \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8, \u0DC3\u0DC4 \u0D94\u0DB6\u0DA7 \u0D86\u0DC3\u0DB1\u0DCA\u0DB1\u0DBA\u0DD9\u0DB1\u0DCA \u0DC0\u0DD9\u0DC3\u0DD9\u0DB1 \u0DB8\u0DD2\u0DB1\u0DD2\u0DC3\u0DD4\u0DB1\u0DCA \u0DB8\u0DD4\u0DAB \u0D9C\u0DD0\u0DB1\u0DD3\u0DB8 \u0DC3\u0DB3\u0DC4\u0DCF \u0DC3\u0DBB\u0DBD \u0DC0\u0DD2\u0DC3\u0DB3\u0DD4\u0DB8\u0D9A\u0DCA \u0DBD\u0DB6\u0DCF \u0DAF\u0DDA.<br /><br />On OLX you can:<br /><ul><li>\u0DA1\u0DCF\u0DBA\u0DCF\u0DBB\u0DD6\u0DB4 \u0DC3\u0DC4 \u0DC0\u0DD3\u0DA9\u0DD2\u0DBA\u0DDD \u0DC3\u0DC4\u0DD2\u0DAD \u0DAD\u0DAF \u0DC0\u0DBB\u0DCA\u0DAB\u0DC0\u0DBD\u0DD2\u0DB1\u0DCA \u0DBA\u0DD4\u0DAD\u0DCA \u0DBD\u0DD0\u0DBA\u0DD2\u0DC3\u0DCA\u0DAD\u0DD4 \u0DB4\u0DC4\u0DC3\u0DD4\u0DC0\u0DD9\u0DB1\u0DCA \u0DB1\u0DD2\u0DBB\u0DCA\u0DB8\u0DCF\u0DAB\u0DBA \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1</li><li>\u0D94\u0DB6\u0DDA \u0DC0\u0DD2\u0D9A\u0DD2\u0DAB\u0DD3\u0DB8\u0DCA, \u0DB8\u0DD2\u0DBD\u0DA7 \u0D9C\u0DD0\u0DB1\u0DD3\u0DB8\u0DCA, \u0DC3\u0DC4 \u0DB4\u0DCA\u200D\u0DBB\u0DA2\u0DCF \u0DC3\u0DDA\u0DC0\u0DCF \u0DB8\u0D9C\u0DDA OLX</li><li> \u0DC4\u0DD2\u0DAF\u0DD3 \u0DB4\u0DCF\u0DBD\u0DB1\u0DBA \u0D9A\u0DBB\u0DBA\u0DD2 \u0D94\u0DB6\u0DDA \u0DC3\u0DB8\u0DCF\u0DA2 \u0DA2\u0DCF\u0DBD \u0DB4\u0DD0\u0DAD\u0DD2\u0D9A\u0DA9\u0DDA (Facebook, Myspace...)\u0DC4\u0DD2 \u0D94\u0DB6\u0DDA \u0DBD\u0DD0\u0DBA\u0DD2\u0DC3\u0DCA\u0DAD\u0DD4 \u0DB4\u0DC5 \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1 </li><li>\u0D94\u0DB6\u0DDA \u0DA2\u0D82\u0D9C\u0DB8 \u0DAF\u0DD4\u0DBB\u0D9A\u0DAE\u0DB1\u0DBA\u0DD9\u0DB1\u0DCA \u0DC0\u0DD9\u0DB6\u0DCA \u0D85\u0DA9\u0DC0\u0DD2\u0DBA \u0DC0\u0DD9\u0DAD \u0DB4\u0DCA\u200D\u0DBB\u0DC0\u0DDA\u0DC1 \u0DC0\u0DB1\u0DCA\u0DB1</li><li>\u0DB4\u0DD9\u0DB1\u0DCA\u0DC0\u0DB1\u0DCA\u0DB1 OLX \u0D94\u0DB6\u0DDA \u0DB4\u0DCA\u200D\u0DBB\u0DCF\u0DAF\u0DDA\u0DC1\u0DD3\u0DBA \u0DB7\u0DCF\u0DC2\u0DCF\u0DC4\u0DD2\u0DAF\u0DD3</li></ul><br />OLX \u0DBA\u0DB1\u0DCA\u0DB1  <<QTY_COUNTRIES>> \u0D85\u0DB0\u0DD2\u0D9A \u0DBB\u0DA7\u0DC0\u0DBD\u0DCA \u0DC3\u0D82\u0D9B\u0DCA\u200D\u0DBA\u0DCF\u0DC0\u0D9A \u0DB7\u0DCF\u0DC2\u0DCF <<QTY_LANGUAGES>> \u0DB4\u0DD9\u0DB1\u0DCA\u0DC0\u0DB1\u0DD4 \u0DBD\u0DD0\u0DB6\u0DDA. \u0DC3\u0DB8\u0DCF\u0D9C\u0DB8 \u0D86\u0DBB\u0DB8\u0DCA\u0DB7 \u0D9A\u0DBB\u0DB1 \u0DBD\u0DAF\u0DCA\u0DAF\u0DDA 2006 \u0DB8\u0DCF\u0DBB\u0DCA\u0DAD\u0DD4 \u0DB8\u0DCF\u0DC3\u0DBA\u0DDA\u0DAF\u0DD3 \u0DC0\u0DB1 \u0D85\u0DAD\u0DBB \u0D91\u0DBA \u0DB4\u0DDE\u0DAF\u0DCA\u0D9C\u0DBD\u0DD2\u0D9A\u0DC0 \u0DAD\u0DB6\u0DCF \u0D9C\u0DD0\u0DB1\u0DDA.</p>',
