    'featured_listings.AdditionalTermsForFeaturedAds_content': '\u0DB8\u0DD9\u0DB8 \u0D85\u0DB8\u0DAD\u0DBB \u0D9A\u0DDC\u0DB1\u0DCA\u0DAF\u0DDA\u0DC3\u0DD2, \u0DC0\u0DD9\u0DB6\u0DCA \u0D85\u0DA9\u0DC0\u0DD2\u0DBA\u0DDA <<LINK_TERMS_USE>>\u0DB7\u0DCF\u0DC0\u0DD2\u0DAD \u0D9A\u0DDC\u0DB1\u0DCA\u0DAF\u0DDA\u0DC3\u0DD2<</LINK_TERMS_USE>>\u0DC0\u0DBD\u0DA7 \u0D85\u0DB8\u0DAD\u0DBB\u0DC0, \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0DD3\u0D9A\u0DD8\u0DAD \u0DC0\u0DD9\u0DC5\u0DB3 \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD\u0DBA \u0D86\u0DC0\u0DBB\u0DAB\u0DBA \u0D9A\u0DBB\u0DBA\u0DD2:<br /><ul><li>\u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0DD3\u0D9A\u0DD8\u0DAD \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA\u0DC0\u0DBD\u0DA7 \u0DC3\u0DCF\u0D9A\u0DCA\u0DC2\u0DD2\u0DBA\u0D9A\u0DCA \u0DBD\u0DD9\u0DC3, OLX \u201C\u0D87\u0DB1\u0DC0\u0DD4\u0DB8 \u0DAD\u0DC4\u0DC0\u0DD4\u0DBB\u0DD4 \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u201D \u0D9A\u0DCA \u0DB4\u0DB8\u0DAB\u0D9A\u0DCA \u0DB1\u0DD2\u0D9A\u0DD4\u0DAD\u0DCA \u0D9A\u0DBB\u0DB1 \u0D85\u0DAD\u0DBB \u0D91\u0DBA \u0D9C\u0DD9\u0DC0\u0DD3\u0DB8\u0DCA \u0D9A\u0DCA\u200D\u0DBB\u0DD2\u0DBA\u0DCF\u0DC0\u0DBD\u0DD2\u0DBA\u0DA7 \u0DB4\u0DC3\u0DD4\u0DC0 \u0DC3\u0DC4 \u0D8A\u0DB8\u0DDA\u0DBD\u0DCA \u0DAD\u0DC4\u0DC0\u0DD4\u0DBB\u0DD4 \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0DA7 \u0DB4\u0DC3\u0DD4\u0DC0 \u0D94\u0DB6\u0DA7 \u0DB4\u0DD9\u0DB1\u0DD9\u0DB1\u0DD4 \u0D87\u0DAD.</li><li>\u0D9A\u0DD2\u0DC3\u0DD2\u0DBA\u0DB8\u0DCA \u0DC4\u0DDA\u0DAD\u0DD4\u0DC0\u0D9A\u0DCA \u0DB8\u0DAD, \u0D91\u0DB1\u0DB8\u0DCA \u0DAD\u0DCF\u0D9A\u0DCA\u0DC2\u0DAB\u0DD2\u0D9A \u0DC4\u0DDD \u0DC0\u0DD9\u0DB1\u0DAD\u0DCA \u0D9A\u0DD2\u0DC3\u0DD2\u0DBA\u0DB8\u0DCA \u0D86\u0D9A\u0DCF\u0DBB\u0DBA\u0D9A \u0DC4\u0DDA\u0DAD\u0DD4\u0DC0\u0D9A\u0DCA \u0DB8\u0DAD, \u0D94\u0DB6\u0DDA \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8 \u201C\u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0DD3\u0D9A\u0DD8\u0DAD \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA\u201D \u0D9A\u0DDC\u0DA7\u0DC3\u0DD9\u0DC4\u0DD2 \u0DB1\u0DDC\u0DAF\u0DD2\u0DC3\u0DCA\u0DC0\u0DB1\u0DD4 \u0D87\u0DAD, OLX\u0DC4\u0DD2 \u0D91\u0D9A\u0DB8 \u0DB6\u0DD0\u0DB3\u0DD3\u0DB8 \u0DC0\u0DB1\u0DD4\u0DBA\u0DDA, \u0DB4\u0DCA\u200D\u0DBB\u0DCF\u0DBA\u0DDD\u0D9C\u0DD2\u0D9A\u0DC0 \u0DC4\u0DD0\u0D9A\u0DD2 \u0D89\u0D9A\u0DCA\u0DB8\u0DAB\u0DD2\u0DB1\u0DCA \u0D94\u0DB6\u0DDA \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8 "\u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0DD3\u0D9A\u0DD8\u0DAD \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA\u201D \u0DB4\u0DCA\u200D\u0DBB\u0DAF\u0DDA\u0DC1\u0DBA\u0DDA \u0DB4\u0DC5 \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8 \u0DC0\u0DDA.</li><li>\u0DAD\u0DD9\u0DC0\u0DB1 \u0DB4\u0DCF\u0DBB\u0DCA\u0DC1\u0DCA\u0DC0 \u0DC3\u0DDA\u0DC0\u0DCF \u0DC3\u0DB4\u0DBA\u0DB1\u0DCA\u0DB1\u0DD9\u0D9A\u0DD4 \u0D85\u0DB4\u0D9C\u0DDA \u0DB6\u0DD2\u0DBD\u0DCA\u0DB4\u0DAD\u0DCA\u0D9A\u0DBB\u0DAB \u0DC0\u0DD2\u0DC3\u0DB3\u0DD4\u0DB8 \u0DBD\u0DB6\u0DCF \u0DAF\u0DD9\u0DB1\u0DD4 \u0D87\u0DAD.</li><li>At OLX \u0DC4\u0DD2 \u0DB4\u0DBB\u0DB8 \u0D85\u0DB7\u0DD2\u0DB8\u0DAE\u0DBA \u0DC0\u0DB1\u0DD4\u0DBA\u0DDA, \u0D85\u0DC3\u0DB7\u0DCA\u200D\u0DBA, \u0D85\u0DC3\u0DB7\u0DCA\u200D\u0DBA \u0DA1\u0DCF\u0DBA\u0DCF\u0DBB\u0DD6\u0DB4 \u0DC3\u0DC4\u0DD2\u0DAD, \u0DC3\u0DCA\u0DB4\u0DD1\u0DB8\u0DCA (\u0DAF\u0DCA\u0DC0\u0DD2\u0DAD\u0DCA\u0DC0\u0D9A\u0DBB\u0DAB \u0DBD\u0DD0\u0DBA\u0DD2\u0DC3\u0DCA\u0DAD\u0DD4 \u0D87\u0DAD\u0DD4\u0DC5\u0DD4\u0DC0), \u0DC3\u0DCA\u0D9A\u0DD1\u0DB8\u0DCA \u0DC0\u0DD2\u0DBA \u0DC4\u0DD0\u0D9A\u0DD2 \u0DC4\u0DDD \u0D9A\u0DD2\u0DC3\u0DD2\u0DBA\u0DB8\u0DCA \u0DB4\u0DCA\u200D\u0DBB\u0D9A\u0DCF\u0DC1\u0DB1 \u0DC4\u0DD2\u0DB8\u0DD2\u0D9A\u0DB8\u0D9A\u0DCA \u0D8B\u0DBD\u0DCA\u0DBD\u0D82\u0D9D\u0DB1\u0DBA \u0DC0\u0DB1 \u0DAF\u0DDA\u0DC0\u0DBD\u0DCA \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0DD3\u0D9A\u0DD8\u0DAD \u0DB1\u0DDC\u0DC0\u0DB1\u0DD4 \u0D87\u0DAD\u0DD2 \u0D85\u0DAD\u0DBB \u0D9C\u0DD9\u0DC0\u0DD3\u0DB8 \u0DB4\u0DCA\u200D\u0DBB\u0DAD\u0DD2\u0DB4\u0DD6\u0DBB\u0DCA\u0DAB\u0DBA/\u0D86\u0DB4\u0DC3\u0DD4 \u0DBD\u0DB6\u0DCF \u0DB1\u0DDC\u0DAF\u0DD9\u0DB1\u0DD4 \u0D87\u0DAD.</li><li>\u0DB8\u0DD9\u0DB8 \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0DD3\u0D9A\u0DD8\u0DAD \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA \u0DC3\u0DDA\u0DC0\u0DCF\u0DC0 \u0DBD\u0DB6\u0DCF \u0DAF\u0DD9\u0DB1\u0DCA\u0DB1\u0DDA \u201C\u0DB4\u0DC0\u0DAD\u0DD2\u0DB1 \u0D86\u0D9A\u0DCF\u0DBB\u0DBA\u0DA7\u201D \u0DC4\u0DDD "\u0DAD\u0DD2\u0DB6\u0DD9\u0DB1 \u0D86\u0D9A\u0DCF\u0DBB\u0DBA\u0DA7" \u0DC4\u0DDD \u0DC0\u0DB1 \u0DB4\u0DAF\u0DB1\u0DB8\u0DD2\u0DB1\u0DCA \u0DC0\u0DB1 \u0D85\u0DAD\u0DBB, \u0D92 \u0DC3\u0DB3\u0DC4\u0DCF \u0DB1\u0DD3\u0DAD\u0DD2\u0DBA\u0DD9\u0DB1\u0DCA \u0D89\u0DA9 \u0DBD\u0DB6\u0DCF \u0DAF\u0DD3 \u0D87\u0DAD\u0DD2 \u0D8B\u0DB4\u0DBB\u0DD2\u0DB8 \u0DB4\u0DCA\u200D\u0DBB\u0DB8\u0DCF\u0DAB\u0DBA\u0DA7 \u0D9A\u0DD2\u0DC3\u0DD2\u0DAF\u0DD4 \u0DC0\u0D9C\u0D9A\u0DD3\u0DB8\u0D9A\u0DCA \u0DB1\u0DDC\u0DB8\u0DD0\u0DAD\u0DD2\u0DC0\u0DBA.OLX \u0D9A\u0DD2\u0DC3\u0DD2\u0DAF\u0DD4 \u0DC0\u0D9C\u0D9A\u0DD3\u0DB8\u0D9A\u0DCA \u0DC3\u0DD2\u0DAF\u0DD4 \u0DBD\u0DB6\u0DCF \u0DB1\u0DDC\u0DAF\u0DD9\u0DB1 \u0D85\u0DAD\u0DBB \u0D9A\u0DD2\u0DC3\u0DD2\u0DAF\u0DD4 \u0DB1\u0DD2\u0DBA\u0DDD\u0DA2\u0DB1\u0DBA\u0D9A\u0DCA \u0DC3\u0DD2\u0DAF\u0DD4 \u0DB1\u0DDC\u0D9A\u0DBB\u0DB1 \u0D85\u0DAD\u0DBB \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0DD3\u0D9A\u0DD8\u0DAD \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA \u0DC3\u0DDA\u0DC0\u0DCF\u0DC0 \u0DAD\u0DD4\u0DC5 \u0DAF\u0D9A\u0DCA\u0DC0\u0DCF \u0D87\u0DAD\u0DD2 \u0DB1\u0DD2\u0DBB\u0DC0\u0DAF\u0DCA\u200D\u0DBA\u0DAD\u0DCF\u0DC0\u0DBA \u0DC3\u0DC4 \u0DB4\u0DBB\u0DD2\u0DB4\u0DD4\u0DBB\u0DCA\u0DAB\u0DAD\u0DCA\u0DC0\u0DBA \u0DB4\u0DD2\u0DC5\u0DD2\u0DB6\u0DB3\u0DC0 \u0D9A\u0DD2\u0DC3\u0DD2\u0DAF\u0DD4 \u0DB6\u0DD0\u0DB3\u0DD3\u0DB8\u0D9A\u0DCA \u0DC4\u0DDD \u0DC0\u0D9C\u0D9A\u0DD3\u0DB8\u0D9A\u0DCA \u0DB7\u0DCF\u0DBB \u0D9C\u0DB1\u0DD4 \u0DB1\u0DDC\u0DBD\u0DB6\u0DBA\u0DD2.</li></ul>',
