    'featured_listings.HowDoesItWork_New': '\u0D89\u0DC4\u0DC5\u0DB8 \u0DBD\u0DD0\u0DBA\u0DD2\u0DC3\u0DCA\u0DAD\u0DD4 \u0DC3\u0DC4 \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA \u0DC3\u0DD9\u0DC0\u0DD3\u0DB8\u0DCA \u0DB4\u0DCA\u0DBB\u0DCA\u0DAD\u0DD2\u0DB5\u0DBD \u0DC3\u0DB3\u0DC4\u0DCF, \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0D9A\u0DD8\u0DAD \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA \u0DB4\u0DD9\u0DB1\u0DCA\u0DC0\u0DB1\u0DD4 \u0DBD\u0DB6\u0DB1\u0DCA\u0DB1\u0DDA \u0D85\u0DAF\u0DCF\u0DC5 \u0D8B\u0DB4 \u0D9A\u0DCF\u0DAB\u0DCA\u0DA9\u0DBA \u0DB8\u0DAD \u0DC0\u0DB1 \u0D85\u0DAD\u0DBB \u0D91\u0DB8 \u0D8B\u0DB4 \u0D9A\u0DCF\u0DAB\u0DCA\u0DA9\u0DBA \u0DC3\u0DC4 \u0DB4\u0DD2\u0DC4\u0DD2\u0DA7\u0DD3\u0DB8 \u0DC3\u0DAF\u0DC4\u0DCF \u0DC0\u0DB1 \u0DC3\u0DD2\u0DBA\u0DBD\u0DD4 \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA \u0D85\u0DAD\u0DBB \u0D85\u0DC4\u0DB9\u0DD4 \u0DBD\u0DD9\u0DC3 \u0DB7\u0DCA\u0DBB\u0DA9\u0DB8\u0DAB\u0DBA \u0DC0\u0DDA. \u0DC3\u0DD2\u0DBA\u0DBD\u0DD4\u0DB8 \u0D85\u0DC0\u0DC3\u0DCA\u0DAE\u0DCF\u0DC0\u0DBD\u0DAF\u0DD3, \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0D9A\u0DD8\u0DAD \u0DBD\u0DD0\u0DBA\u0DD2\u0DC3\u0DCA\u0DAD\u0DD4\u0DC0\u0DDA \u0DAD\u0DDA\u0DB8\u0DD3\u0DB8 \u0DC3\u0DCF\u0DB8\u0DCF\u0DB1\u0DCA\u0DBA\u0DD9\u0DB4\u0DBA\u0DB1\u0DCA \u0DC3\u0DD2\u0DAF\u0DD4 \u0D9A\u0DD9\u0DBB\u0DD9\u0DB1\u0DD4\u0DBA\u0DDA \u0DC0\u0DD9\u0DB6\u0DCA \u0D85\u0DA9\u0DC0\u0DD2\u0DBA\u0DDA \u0DC3\u0DB8\u0DCF\u0DB1 \u0D85\u0DC0\u0DC3\u0DCA\u0DAE\u0DCF \u0DB4\u0DCA\u0DBB\u0DBA\u0DAF\u0DBB\u0DCA\u0DC1\u0DB1\u0DBA \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0DA7 \u0DC3\u0DD2\u0DBA\u0DBD\u0DD4 \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0D9A\u0DD8\u0DAD \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA \u0DB8\u0DD2\u0DBD\u0DA7 \u0D9C\u0DD0\u0DB1\u0DD3\u0DB8\u0DCA \u0DB4\u0DD9\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8 \u0DC3\u0DB3\u0DC4\u0DCF\u0DBA. \u0D94\u0DB6\u0DDA \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA \u0DC4\u0DD0\u0DB8\u0DC0\u0DD2\u0DA7\u0DB8 \u0D85\u0DAF\u0DCF\u0DC5 \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0D9A\u0DD8\u0DAD \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA \u0D9A\u0DDC\u0DA7\u0DC3\u0DDA \u0DB1\u0DDC\u0DB4\u0DD9\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DA7 \u0D89\u0DA9 \u0D87\u0DAD\u0DCA\u0DAD\u0DDA \u0D91\u0DB6\u0DD0\u0DC0\u0DD2\u0DB1\u0DD2.',
    'featured_listings.HowDoIBuyAFeaturedListing': '\u0DB8\u0DCF \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0D9A\u0DD8\u0DAD \u0DBD\u0DD0\u0DBA\u0DD2\u0DC3\u0DCA\u0DAD\u0DD4\u0DC0\u0D9A\u0DCA \u0DB8\u0DD2\u0DBD\u0DA7 \u0D9C\u0DB1\u0DCA\u0DB1\u0DDA \u0D9A\u0DD9\u0DC3\u0DDA\u0DAF?',
    'featured_listings.HowDoIBuyAFeaturedListing_New': '\u0D94\u0DB6\u0D9C\u0DDA \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8 \u0DB4\u0DC5 \u0D9A\u0DBB \u0D87\u0DAD\u0DD2 \u0DB6\u0DC0\u0DA7 \u0DB4\u0DC5 \u0D9A\u0DD9\u0DBB\u0DD9\u0DB1 \u0DAD\u0DC4\u0DC0\u0DD4\u0DBB\u0DD4 \u0D9A\u0DD9\u0DBB\u0DD9\u0DB1 \u0DB4\u0DC5 \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0DDA \u0D9A\u0DCA\u200D\u0DBB\u0DD2\u0DBA\u0DCF\u0DC0\u0DBD\u0DD2\u0DBA\u0DDA \u0D85\u0DC0\u0DC3\u0DB1\u0DCA \u0DB4\u0DD2\u0DBA\u0DC0\u0DBB\u0DD9\u0DB1\u0DCA \u0DC4\u0DDD My OLX \u0DC0\u0DD9\u0DAD\u0DD2\u0DB1\u0DCA \u0D94\u0DB6\u0DA7 \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0D9A\u0DD8\u0DAD \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0D9A\u0DCA \u0DB8\u0DD2\u0DBD\u0DA7 \u0D9C\u0DAD \u0DC4\u0DD0\u0D9A\u0DD2\u0DBA. \u0DB8\u0DD9\u0DB8 \u0D9A\u0DCA\u200D\u0DBB\u0DD2\u0DBA\u0DCF\u0DC0\u0DBD\u0DD2\u0DBA \u0D85\u0DC0\u0D82\u0D9A \u0D91\u0D9A\u0D9A\u0DD2. \u0D94\u0DB6\u0DDA \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8 \u0DC3\u0DAD\u0DD2 \u0D9A\u0DD3\u0DBA\u0D9A\u0DCA \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0D9A\u0DD8\u0DAD \u0DC0\u0DD3 \u0DAD\u0DD2\u0DB6\u0DD2\u0DBA \u0DBA\u0DD4\u0DAD\u0DD4\u0DAF\u0DD0\u0DBA\u0DD2 \u0D94\u0DB6 \u0DAD\u0DDA\u0DBB\u0DD2\u0DBA \u0DBA\u0DD4\u0DAD\u0DD4\u0DBA. \u0D89\u0DB1\u0DCA\u0DB4\u0DC3\u0DD4\u0DC0 \u0D94\u0DB6\u0DC0 \u0DC0\u0DD2\u0DC0\u0DD2\u0DB0 \u0D9C\u0DD9\u0DC0\u0DD3\u0DB8\u0DCA \u0DC0\u0DD2\u0D9A\u0DBD\u0DCA\u0DB4 \u0DC3\u0DC4\u0DD2\u0DAD \u0D9C\u0DD9\u0DC0\u0DD3\u0DB8\u0DCA \u0DB4\u0DD2\u0DA7\u0DD4\u0DC0\u0D9A\u0DCA \u0DC0\u0DD9\u0DAD \u0DBB\u0DD0\u0D9C\u0DD9\u0DB1 \u0DBA\u0DB1\u0DD4 \u0D87\u0DAD. \u0D9C\u0DD9\u0DC0\u0DD3\u0DB8 \u0DC3\u0DD2\u0DAF\u0DD4 \u0D9A\u0DC5 \u0DB4\u0DC3\u0DD4, \u0DAD\u0DDD\u0DBB\u0DB1 \u0DBD\u0DAF \u0DC0\u0DDA\u0DBD\u0DCF\u0DC0\u0DAF \u0D87\u0DAD\u0DD4\u0DBD\u0DD4\u0DC0 \u0D94\u0DB6\u0DDA \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8 \u0DAD\u0DD2\u0DB6\u0DD9\u0DB1 \u0DC0\u0DDA\u0DBD\u0DCF\u0DC0 \u0DAD\u0DC4\u0DC0\u0DD4\u0DBB\u0DD4 \u0D9A\u0DD9\u0DBB\u0DD9\u0DB1 \u0DB4\u0DAB\u0DD2\u0DC0\u0DD4\u0DA9\u0DBA\u0D9A\u0DCA \u0D94\u0DB6 \u0DC0\u0DD9\u0DAD \u0DBD\u0DD0\u0DB6\u0DD9\u0DB1\u0DD4 \u0D87\u0DAD. \u0D94\u0DB6\u0D9C\u0DDA \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8 OLX \u0DB7\u0DCF\u0DC0\u0DD2\u0DAD \u0DB1\u0DD2\u0DBA\u0DB8\u0DBA\u0DB1\u0DCA \u0DC4\u0DCF \u0D85\u0DB1\u0DD4\u0D9A\u0DD6\u0DBD \u0DC0\u0DDA \u0DB1\u0DB8\u0DCA, \u0D94\u0DB6\u0DA7 \u0D8A\u0DB8\u0DDA\u0DBD\u0DCA \u0DAD\u0DC4\u0DC0\u0DD4\u0DBB\u0DD4 \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0D9A\u0DCA \u0DBD\u0DD0\u0DB6\u0DD9\u0DB1\u0DD4 \u0D87\u0DAD. \u0D94\u0DB6 \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0D9A\u0DD8\u0DAD \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0D9A\u0DCA \u0DB8\u0DD2\u0DBD\u0DA7 \u0D9C\u0DAD\u0DCA \u0DB4\u0DC3\u0DD4\u0DC0 \u0D85\u0DBB\u0DB8\u0DD4\u0DAF\u0DBD\u0DCA \u0D86\u0DB4\u0DC3\u0DD4 \u0D9A\u0DD2\u0DC3\u0DD2\u0DC3\u0DDA\u0DAD\u0DCA\u0DB8 \u0D9C\u0DD9\u0DC0\u0DD2\u0DBA \u0DB1\u0DDC\u0DC4\u0DD0\u0D9A\u0DD2 \u0DB6\u0DC0 \u0DC3\u0DD2\u0DC4\u0DD2 \u0DAD\u0DB6\u0DCF \u0D9C\u0DB1\u0DCA\u0DB1. \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0D9A\u0DD8\u0DAD \u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8\u0DCA\u0DC0\u0DBD \u0DC3\u0DD2\u0DBA\u0DBD\u0DD4 \u0DC0\u0DD2\u0D9A\u0DD2\u0DAB\u0DD3\u0DB8\u0DCA \u0D85\u0DC0\u0DC3\u0DB1\u0DCA \u0DC0\u0DD2\u0D9A\u0DD2\u0DAB\u0DD3\u0DB8\u0DCA \u0DC0\u0DDA.',
    'featured_listings.HowDoIFeatureMyAd': '\u0DAF\u0DD0\u0DB1\u0DCA\u0DC0\u0DD3\u0DB8 \u0DC0\u0DD9\u0DB1\u0DC3\u0DCA \u0D9A\u0DBB\u0DB1\u0DCA\u0DB1\u0DDA \u0D9A\u0DD9\u0DC3\u0DDA\u0DAF?',
    'featured_listings.HowLongWillMyListingAppearInFeaturedListings': '\u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0D9A\u0DD8\u0DAD \u0DBD\u0DD0\u0DBA\u0DD2\u0DC3\u0DCA\u0DAD\u0DD4 \u0D9A\u0DDC\u0DA7\u0DC3\u0DDA \u0DB8\u0D9C\u0DDA \u0DBD\u0DD0\u0DBA\u0DD2\u0DC3\u0DCA\u0DAD\u0DD4\u0DC0 \u0D9A\u0DDC\u0DB4\u0DB8\u0DAB \u0D9A\u0DCF\u0DBD\u0DBA\u0D9A\u0DCA \u0DB4\u0DD9\u0DB1\u0DCA\u0DB1\u0DD4\u0DB8\u0DCA \u0D9A\u0DBB\u0DBA\u0DD2\u0DAF?',
    'featured_listings.HowLongWillMyListingAppearInFeaturedListings_content': '\u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C\u0D9A\u0DD8\u0DAD \u0DBD\u0DD0\u0DBA\u0DD2\u0DC3\u0DCA\u0DAD\u0DD4 \u0DB4\u0DD9\u0DB1\u0DCA\u0DB1\u0DD4\u0DB8\u0DCA \u0D85\u0DBD\u0DD9\u0DC0\u0DD2 \u0D9A\u0DD9\u0DBB\u0DD9\u0DB1\u0DD4\u0DBA\u0DDA \u0DC3\u0DAD\u0DD2\u0DBA\u0D9A\u0DA7 \u0DC0\u0DBB\u0D9A\u0DD2 (\u0DAF\u0DD2\u0DB1 7). \u0D94\u0DB6\u0DA7 \u0D94\u0DB6\u0DDA \u0DBD\u0DD0\u0DBA\u0DD2\u0DC3\u0DCA\u0DAD\u0DD4 \u0DC3\u0DAD\u0DD2 4\u0D9A \u0D9A\u0DCF\u0DBD\u0DBA\u0D9A\u0DCA \u0DAF\u0D9A\u0DCA\u0DC0\u0DCF \u0DC0\u0DD2\u0DC1\u0DDA\u0DC2\u0DCF\u0D82\u0D9C \u0D9A\u0DC5 \u0DC4\u0DD0\u0D9A\u0DD2\u0DBA.',
    'featured_listings.HowMuchDoesItCost': '\u0D8A\u0DA7 \u0D9A\u0DDC\u0DB4\u0DB8\u0DAB \u0DB8\u0DD4\u0DAF\u0DBD\u0DCA \u0DC0\u0DD0\u0DBA \u0DC0\u0DDA\u0DAF?',
